import React, { useRef, useEffect, useState } from 'react';
import { View, Text, Image, TextInput, TouchableOpacity, Animated, Alert } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import { useNavigation } from '@react-navigation/native';
import useAuth from '../hooks/auth';
import { Picker } from '@react-native-community/picker'; // Use this import

export default function SignUpView() {
  const navigation = useNavigation();
  const fadeAnim = useRef(new Animated.Value(0)).current;

  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [userType, setUserType] = useState('buyer'); // Default to 'buyer', change as needed

  const { signUp } = useAuth();

  useEffect(() => {
    Animated.timing(fadeAnim, {
      toValue: 1,
      duration: 1000,
      useNativeDriver: true,
    }).start();
  }, [fadeAnim]);

  const handleSignUp = async () => {
    try {
      // Call the signUp function from useAuth hook
      await signUp(email, password, { fullName, userType });
      // Handle successful signup, navigate to the home screen, or show a success message
      Alert.alert('Success', 'Account created successfully');
      navigation.navigate('Home');
    } catch (error) {
      // Handle signup error, show an error message to the user
      Alert.alert('Error', error.message);
    }
  };

  return (
    <View style={{ flex: 1, backgroundColor: 'white' }}>
      <StatusBar style="light" />
      <Image source={require('../assets/background.png')} style={{ position: 'absolute', height: '100%', width: '100%' }} />

      {/* lights */}
      <View style={{ flexDirection: 'row', justifyContent: 'space-around', position: 'absolute' }}>
        <Animated.Image
          source={require('../assets/light.png')}
          style={{ height: 225, width: 90, opacity: fadeAnim }}
        />
        <Animated.Image
          source={require('../assets/light.png')}
          style={{ height: 225, width: 90, opacity: fadeAnim }}
        />
      </View>

      {/* title and form */}
      <View style={{ flex: 1, justifyContent: 'center', marginHorizontal: 5 }}>
        {/* title */}
        <View style={{ alignItems: 'center' }}>
          <Animated.Text style={{ color: 'white', fontWeight: 'bold', fontSize: 30, opacity: fadeAnim }}>
            Sign Up
          </Animated.Text>
        </View>

        {/* form */}
        <View style={{ marginTop: 200 }}>
          <Animated.View style={{ backgroundColor: 'rgba(0, 0, 0, 0.1)', padding: 15, borderRadius: 10, marginBottom: 10, opacity: fadeAnim }}>
            <TextInput
              placeholder="Full Name"
              placeholderTextColor={'gray'}
              style={{ color: 'gray' }}
              onChangeText={(text) => setFullName(text)}
            />
          </Animated.View>
          <Animated.View style={{ backgroundColor: 'rgba(0, 0, 0, 0.1)', padding: 15, borderRadius: 10, marginBottom: 10, opacity: fadeAnim }}>
            <TextInput
              placeholder="Email"
              placeholderTextColor={'gray'}
              style={{ color: 'gray' }}
              onChangeText={(text) => setEmail(text)}
            />
          </Animated.View>
          <Animated.View style={{ backgroundColor: 'rgba(0, 0, 0, 0.1)', padding: 15, borderRadius: 10, marginBottom: 10, opacity: fadeAnim }}>
            <TextInput
              placeholder="Password"
              placeholderTextColor={'gray'}
              secureTextEntry
              style={{ color: 'gray' }}
              onChangeText={(text) => setPassword(text)}
            />
          </Animated.View>

          {/* Add Picker for selecting user type */}
          <Animated.View style={{ backgroundColor: 'rgba(0, 0, 0, 0.1)', padding: 15, borderRadius: 10, marginBottom: 10, opacity: fadeAnim }}>
            <Picker
              selectedValue={userType}
              onValueChange={(itemValue) => setUserType(itemValue)}
              style={{ color: 'gray' }}
            >
              <Picker.Item label="Buyer" value="buyer" />
              <Picker.Item label="Seller" value="seller" />
            </Picker>
          </Animated.View>

          <Animated.View style={{ backgroundColor: '#00BFFF', padding: 10, borderRadius: 10, marginBottom: 10, opacity: fadeAnim }}>
            <TouchableOpacity onPress={handleSignUp}>
              <Text style={{ fontSize: 18, fontWeight: 'bold', color: 'white', textAlign: 'center' }}>Sign Up</Text>
            </TouchableOpacity>
          </Animated.View>

          <Animated.View style={{ flexDirection: 'row', justifyContent: 'center', opacity: fadeAnim }}>
            <Text>Already have an account? </Text>
            <TouchableOpacity onPress={() => navigation.push('Login')}>
              <Text style={{ color: '#00BFFF' }}>Login</Text>
            </TouchableOpacity>
          </Animated.View>
        </View>
      </View>
    </View>
  );
}
